      <Route path="/" element={<Navbar/>} />
      <Route path="/ToDo" element={<ToDo/>} />
      <Route path="/Login" element={<Login/>} />
      <Route path="/Fatchapi" element={<Fatchapi/>} />
      <Route path="/PostApi" element={<PostApi/>} />
     </Routes>

    </div>

  );
}

export default App;
